// index.js
import React from 'react';
import Log from './Log';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';

ReactDOM.render(
  <React.StrictMode>
    <Router>
      <div className="App">
        <Route path="/" component={Log} />
      </div>
    </Router>
  </React.StrictMode>,
  document.getElementById('root')
);
